import React from "react";
import CollectionPreview from '../../component/preview-component/preview-collection.component'
import { connect } from "react-redux";
const ShopPage = ({ShopData}) => {
    // Object.entries(ShopData).forEach(([key, value]) => {
    //     console.log(key, value);

    // })
   return(<div className="shop-page">

        {
            ShopData.forEach(([key, value]) => {
            return <CollectionPreview key={key} value = {value}></CollectionPreview>
        }
)}

{ShopData.map(({id, ...otherSectionProps }) => (
        <CollectionPreview key={id} {...otherSectionProps} />
      ))}



 </div>)
    }

const mapStateToProps = (state) => ({
ShopData: state.shop.SHOP_DATA
})

export default connect(mapStateToProps, null)(ShopPage);
